<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(247,150,70); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">问：你为什么要贩卖儿童？</span><span style="box-sizing: border-box !important; font-size: 14px; max-width: 100%; color: rgb(247,150,70); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><br style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word" />
</span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><strong style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(255,0,0); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">答：钱来得快又比较简单。</span></strong></span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(247,150,70); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">问：你不知道是犯罪吗？</span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><strong style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(255,0,0); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">答：不就是一个小孩吗？他们可以再生呗！</span></strong></span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(247,150,70); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">问：你参与过多少次贩卖儿童的犯罪行为？最多一次拐了几个？</span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><strong style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(255,0,0); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">答：记不清了，每个月都卖好几个。最多一次好像拐了3-4个，记不清了。</span></strong></span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(247,150,70); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">问：被贩卖的儿童的去向？</span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><strong style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(255,0,0); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">答：全国各地都有，有专门的人卖的，我就负责拐。上面人不允许我知道孩子下落，说是怕警察查到他们。</span></strong></span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(247,150,70); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">问：你的作案手法？</span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><strong style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(255,0,0); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">答：哄得听的就骗，太机灵的就抢，不听话的就打晕带走，大人不留神就下手了。</span></strong></span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(247,150,70); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">问：那些孩子会怎样你想过吗？</span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><strong style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(255,0,0); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">答：我也不知道是卖到哪里，我只是负责拐的。城市农村指不定的，我也不知道，哪有要的就卖哪里去。</span></strong></span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(247,150,70); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">问：你是不是瞄准了一些儿童作案的？</span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(255,0,0); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><strong>答：看着健康的就留意一下，穿着漂亮的也留意，质量好的才能卖个好钱，就算是有钱人的小孩也卖不了多几个钱。<br />
</strong><img alt="1217248846759_1217248846759_r" width="450" height="358" src="http://www.tecenet.com/file/upload/201506/18/18-10-49-81-34756.jpg" /></span></span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(247,150,70); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">问：拐卖过程中你是否曾杀害儿童？</span></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><strong style="box-sizing: border-box !important; max-width: 100%; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(255,0,0); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">答：（沉默了一会，点头）那娃哭声太大，差点把人招来，和我一伙的怕事，就把娃丢河里了。这是他干的，不是我！</span></strong></span></p>
<p style="text-align: left"><br />
&nbsp;<img alt="res05_attpic_brief" width="300" height="225" src="http://www.tecenet.com/file/upload/201506/18/18-10-07-51-34756.jpg" /></p>
<p style="text-align: left"><span style="box-sizing: border-box !important; max-width: 100%; color: rgb(255,192,0); padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px; padding-right: 0px; -ms-word-wrap: break-word">面对他回答的每一句，我们心都在滴血。让我们心惊的是他已经不记得贩卖了多少的儿童，让多少家庭破碎，光是一想就恨得牙痒痒！<br />
<br />
